import React from "react";
import './apartado.css'
import { useState , useRef , useEffect} from "react";
import icon from './compressimagen19.jpg'
import Skills from "../../main/header/body/skills/skills";
import Education from "../../main/header/body/education/education";

function Apartado(){
    const textos = {
        1: <h3 class="texto-sobreMi">
            Hello, my name is <strong class="importants-words">Joaquin</strong> and I'm <strong class="importants-words">20</strong> years old. I was born in <strong class="importants-words">Rosario</strong>, a city in <strong class="importants-words">Argentina</strong> and work as a freelancer while I study a technical degree in <strong class="importants-words">programming</strong>. <br />
            I've been a <strong class="importants-words">programmer</strong> since <strong class="importants-words">2021</strong>, and I am currently in the process of searching for a job to further my growth in both knowledge and experience. <br />
            I have gained a lot of experience through the projects I consistently undertake, although I haven't had the chance to work <strong class="importants-words">professionally</strong> yet.
            This is a brief glimpse of who I am.
        </h3>,
        2: Skills(),
        3: Education()
    }

    const [texto,setTexto] = useState(textos[1])

    const textFocus = (event) =>{
        const id = event.target.id;
        buttonRef.current.classList.remove('enfoque');
        id.current.classList.add('enfoque')
        setTexto(textos[id])
    }

    const buttonRef = useRef(null);

    useEffect(() => {
        // Cuando el componente se monta, enfocamos el botón.
        buttonRef.current.classList.add('enfoque');
        
    }, []);
    
    return(
        <div className="apartado11" id="aboutMe">
            <div className="fondo-apartado">
                <div className="fondo-apartado-transparente">
                    <div className="div-image">
                        <img className="icon-joaquin" src={icon} alt="joaquinSanchezTonani" />
                    </div>
                    <h1 className="name-apartado">I'm Joaquin</h1>
                    <h3 style={{color:"white", fontSize:"25px", marginTop:"8px"}}>Programmer</h3>
                    <h3 style={{color:"grey", fontSize:"14px"}}>and</h3>
                    <h3 style={{color:"white", fontSize:"25px"}}>Web developer</h3>
                </div>
                <div className="div-hire-cv">
                    <a className="hire-me" href="#">Hire me</a>
                    <a className="cv-download" href="#">Download CV</a>
                </div>
            </div>
            <div className="fondo-apartado2"> 
                <div className="title-apartado-cont">
                    <button ref={buttonRef} id="1" onFocus={textFocus} type="button" className="title-apartado">About me</button>
                    <button id="2" onFocus={textFocus} type="button" className="title-apartado">Skills</button>
                    <button id="3" onFocus={textFocus} type="button" className="title-apartado">Education</button>
                </div>
                <div className="contenedor-apartado">
                    <p className="p-apartado">{texto}</p>
                </div>
            </div>
        </div>
    )
}

export default Apartado;
